import React, {ReactElement} from 'react';
import {SvgXml} from 'react-native-svg';

export const Logo = (props: { height?: number, width?: number }): ReactElement => {

    const config = { height: 170, width: 170 };
    if (props.height) {
        config.height = props.height;
    }
    if (props.width) {
        config.width = props.width;
    }

    // original content located at assets/editions-charisma-app/svg/logo.svg
    const svgContent = `
<svg width="170" height="170" viewBox="0 0 170 170" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<circle cx="85" cy="85" r="85" fill="white"/>
<rect x="45.6989" y="26.5054" width="79.5161" height="102.366" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0" transform="translate(-0.00622602) scale(0.001341 0.00104167)"/>
</pattern>
<image id="image0" width="755" height="960" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
    `;

    const SvgRender = () => <SvgXml xml={svgContent} width={config.width} height={config.height} /> ;

    return <SvgRender/>;
}
